        blue.addEventListener("click", ()=>
        {
            changeAll("#1A3864", "white", base64_logo_white);
            
            Array.from(fontItems).forEach((item) => 
            {
                item.style.color = "white";
                item.style.border = "1px solid white";
            });

            Array.from(itemMenuAut).forEach((item) => {item.style.color = "white"});
        });

        white.addEventListener("click", ()=>
        {
            changeAll("white", "#1A3864", base64_logo_color);
            Array.from(fontItems).forEach((item) => 
            {
                item.style.color = "#303030";
                item.style.border = "1px solid #303030";
            });

            Array.from(itemMenuAut).forEach((item) => {item.style.color = "#303030"});
        });

        black.addEventListener("click", ()=>
        {
            changeAll("#303030", "white", base64_logo_white);
            Array.from(fontItems).forEach((item) => 
            {
                item.style.color = "white";
                item.style.border = "1px solid white";
            });

            Array.from(itemMenuAut).forEach((item) => {item.style.color = "white"});
        });

        img.addEventListener("click", () =>{panel.classList.toggle("panelMoved")});

        const changeAll = (back, color, logo)=> 
        {
            main.style.backgroundColor = back;
            text.style.color = color;
            textedtwo.style.color = color;
            img.src = logo;
            
            
            switch(amountLogos)
            {
                case 2: 
                    imgDos.src = base64_logo_dos_color;
                    
                    if(logo != base64_logo_white && activar_white_dos==true)
                    {         
                        imgDos.classList.remove("whiteimg");
                    }else 
                    {
                        imgDos.classList.add("whiteimg"); 
                    }
                    break; 

                case 3: 
                    imgDos.src = base64_logo_dos_color;
                    imgTres.src = base64_logo_tres_color;

                    
                    if(logo != base64_logo_white)
                    {
                        (activar_white_dos) || imgDos.classList.remove("whiteimg");
                        (activar_white_tres) || imgTres.classList.remove("whiteimg");
                    }else 
                    {
                        (activar_white_dos) || imgDos.classList.add("whiteimg");   
                        (activar_white_tres) || imgTres.classList.add("whiteimg");
                    }
                    
                    break; 
            }
            abrirPantallaCompleta();
            img.click();
            menuAut.classList.remove("visibleMenuAut");
        }

        maxScreen.addEventListener("click", ()=> 
        {
            abrirPantallaCompleta();
            panel.classList.add("panelMoved");
        });

        function abrirPantallaCompleta() 
        {            
            const elemento = document.documentElement;

            if (elemento.requestFullscreen) elemento.requestFullscreen()
            else if (elemento.webkitRequestFullscreen) elemento.webkitRequestFullscreen()
            else if (elemento.mozRequestFullScreen) elemento.mozRequestFullScreen()
            else if (elemento.msRequestFullscreen) elemento.msRequestFullscreen();
        }

        function changeFont(x) 
        {
            (x ==1)?font+= 0.1:font-= 0.1;
            (x ==1)?fontT+= 0.1:fontT-= 0.1;
            text.style.fontSize = font + "rem";
            textedtwo.style.fontSize = fontT + "rem";
            numberF.innerHTML = font.toFixed(2);
            numberF.style.display = "initial";
            setTimeout(() => {numberF.style.display = "none"}, 3000);
        } 

        document.addEventListener("DOMContentLoaded", ()=>
        {
            blue.click();
            img.click();
        });
